import React from "react";
import "../../assets/css/compeounder.css"; // Adjust the path as needed
import "../../assets/css/innerstyle.css";


const RespiratoryPage = () => {
  return (
    <div>
      <section className="why-choose-box avail-card">
								<figure>
									<img src="images/icons/respiratory.png" alt=""/>
								</figure>
								<h4>RESPIRATORY</h4>
								<a href="#" className="readmoreBtn"><span>Book now</span></a>
							</section>
    </div>
  );
}
export default RespiratoryPage;
